import React, { useEffect, useRef, useState } from "react";
import { Camera, useCameraDevice } from "react-native-vision-camera";
import { AppState, BackHandler, Image, SafeAreaView, StyleSheet, Text, TouchableOpacity, View } from "react-native";
import Pdf from "react-native-pdf";
import Sound from "react-native-sound";
import Orientation from "react-native-orientation-locker";


const initialText = "接下来将展示免除保险人责任条款的书面说明，免除保险人责任条款非常重要，他与您有重大利害关系请您务必认真阅读，如果您在理解上还存在一些困难，可以要求销售人员再次说明。";
const sound_gif = require("./assets/sound.gif");
const mic_gif = require("./assets/mic.gif");


function PdfPageDisclaimer({ navigation }): React.JSX.Element {
  Orientation.lockToLandscapeLeft();
  let device = useCameraDevice("front");
  let isActive = true;
  const [appState, setAppState] = useState(AppState.currentState);
  const soundRef = useRef(null);  // 使用 useRef 来持久化声音实例

  const [rightText, setRightText] = useState(initialText);
  const [rightGif, setRightGif] = useState(sound_gif);


  useEffect(() => {
    // Camera.requestCameraPermission();

    // App state change listener
    const appStateListener = AppState.addEventListener("change", _handleAppStateChange);

    // Hardware back press listener
    const backHandler = BackHandler.addEventListener("hardwareBackPress", handleBackPress);

    return () => {
      // Clean up: release sound and remove listeners
      soundRef.current?.release();
      appStateListener.remove();
      backHandler.remove();
    };
  }, []);

  let s: Sound
  const stage9 = () => {
    const sound = new Sound(require("./assets/stage9.mp3"), (error) => {
      s = sound
      soundRef.current = sound;
      if (!error) {
        sound.play((success) => {
          sound.release();
          soundRef.current = null;
          if (success) {
            console.log("音频9播放完成");
          }
        });
      }
    });
  };

  stage9();

  const handleBackPress = () => {
    soundRef.current?.stop();  // 停止播放声音
    navigation.goBack();
    return true;  // Prevent default back behavior
  };

  const _handleAppStateChange = (nextAppState) => {
    if (appState.match(/inactive|background/) && nextAppState === 'active') {
      console.log('App has come to the foreground!');
    } else if (nextAppState === 'background') {
      console.log('App has gone to the background!');
      soundRef.current?.stop();  // 停止播放声音
    }
    // setAppState(nextAppState);
  };

  let source = { uri: "data:application/pdf;base64," };

  return (
    <SafeAreaView>
      <View style={{ marginTop: 0, height: "100%" }}>
        <View style={{ flexDirection: "row", alignItems: "stretch" }}>
          <View style={{ flex: 5 }}>
            <View style={{
              position: "absolute", // 绝对定位
              bottom: 0, // 定位到图片顶部
              left: 0, // 定位到图片左侧
              right: 0, // 定位到图片右侧
              height: "20%", // 高度为屏幕高度的5%
              backgroundColor: "rgba(128, 128, 128, 0.5)", // 灰色透明背景
              flexDirection: "row",
              justifyContent: "space-between",
              alignItems: "center",
              paddingHorizontal: 10,
              zIndex: 9999
            }}>
              <Text style={{
                color: "#FFFFFF",
                fontSize: 15
              }}>免除保险人责任条款说明，请客户亲自滑屏阅读，他人不可代为操作。</Text>
              <View style={{ flexDirection: "row" }}>
                <TouchableOpacity style={styles.button1} onPress={() => navigation.navigate("PdfPageDisclaimer")}>
                  <Text style={styles.buttonText}>刷新</Text>
                </TouchableOpacity>
                <TouchableOpacity style={styles.button2} onPress={() => {
                  if (s !== undefined) {
                    s.stop().release()
                  }
                  navigation.navigate("Sign")}}>
                  <Text style={styles.buttonText}>核对完毕</Text>
                </TouchableOpacity>
              </View>
            </View>
            <Pdf
              source={source}
              scale={2}
              onLoadComplete={(numberOfPages, filePath) => {
                console.log(`Number of pages: ${numberOfPages}`);
              }}
              onPageChanged={(page, numberOfPages) => {
                console.log(`Current page: ${page}`);
              }}
              onError={(error) => {
                console.log(error);
              }}
              onPressLink={(uri) => {
                console.log(`Link pressed: ${uri}`);
              }}
              style={styles.pdf} />
          </View>

          <View style={{ flex: 1, width: "100%", marginLeft: 10, marginRight: 5 }}>
            <View style={{ height: "25%", marginBottom: 5 }}>
              <Camera
                style={[StyleSheet.absoluteFill, { width: "100%", height: "100%" }]}
                device={device}
                isActive={isActive}
              />
            </View>
            <View style={{ width: "100%", height: "75%" }}>
              <View style={{ height: "100%", width: "140%" }}>
                <Image resizeMode={"stretch"} style={{ width: "100%", height: "100%" }} source={rightGif}></Image>
              </View>
            </View>
          </View>
        </View>
      </View>
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: "flex-start",
    alignItems: "center",
    marginTop: 25
  },
  pdf: {
    flex: 1,
    width: "100%"
  },
  button1: {
    backgroundColor: "#367bd8",
    padding: 10,
    marginHorizontal: 5,
    borderRadius: 5
  },
  button2: {
    backgroundColor: "#ff361e",
    padding: 10,
    marginHorizontal: 5,
    borderRadius: 5
  },
  buttonText: {
    color: "#FFFFFF",
    fontSize: 15
  }
});

export default PdfPageDisclaimer;
